  transition: all 0.3s;
  white-space: nowrap;
}
.btn--heading {
  background: var(--color-heading);
  color: white;
}

.btn--secondary {
  background: var(--color-secondary);
  color: white;
}
.btn--primary {
  background: var(--color-primary);
  color: white;
}

.btn--accent {
  background: var(--color-accent);
  color: white;
}
.btn--outline {
  background: white;
  color: var(--color-heading);
  border: 2px solid var(--color-heading);
}
.btn--block {
  width: 100%;
  display: inline-block;
}

.btn--stretched {
  padding-left: 6rem;
  padding-right: 6rem;
}

.btn .icon {
  width: 30px;
  height: 30px;
  vertical-align: middle;
  margin-right: 10px;
}

.btn--hero {
  display: inline-block;
}
