@media (min-width: 768px) {
  .btn {
    font-size: 1.4rem;
  }
}
/******************Icons******************/
.icon {
  width: 50px;
  height: 50px;
}
.icon--primary {
  fill: var(--color-primary);
}

.icon--small {
  width: 40px;
  height: 40px;
}
.icon--white {
  fill: white;
}
.icon-container {
  display: flex;
  justify-content: center;
  align-items: center;
  background: #f3f9fa;
  border-radius: 100%;
  width: 80px;
  height: 80px;
}
.icon-container-red {
  background: red;
}
/******************List******************/
.list {
  list-style: none;
  padding-left: 0;
  text-transform: capitalize;
}

.list__item {
  color: var(--color-heading);
  font-size: 2.4rem;
  text-transform: capitalize;
}

.list--tick {
  list-style-image: url('/images/tick.svg');
  padding-left: 3rem;
}
.list--tick .list__item {
  padding-left: 0.5rem;
  margin-bottom: 1rem;
}
.list--inline .list__item {
  display: inline-block;
  margin-right: 1rem;
}

/******************Inputs // Input Groups******************/
.input {
  border: 2px solid rgb(58, 4, 219);

  border: 0;
  outline: 0;
  border-radius: var(--border-radius);
  border: 1px solid var(--color-border);
  font-size: 2rem;
  font-weight: 400;
  padding: 2rem 3rem;
  color: var(--color-heading);
}
::placeholder {
  opacity: 0.5;
  text-transform: capitalize;
}
@media (min-width: 768px) {
  .input {
    font-size: 1.5rem;
  }
}

.input-group {
  max-width: 100vh;
  display: flex;
  border-radius: var(--border-radius);
  box-shadow: var(--box-shadow);
  padding: 5px;
}

.input-group .input {
  flex-grow: 1;
  border: 0;
  width: 0;
}
/******************Badges******************/
.badge {
  border-radius: var(--border-radius);
  padding: 1rem 2.5rem;
  font-size: 1.5rem;
  font-weight: 600;
  white-space: nowrap;
}
.badge--primary {
  background: var(--color-primary);
  color: white;
}
.badge--secondary {
  background: var(--color-secondary);
  color: white;
}
.badge--small {
  font-size: 1.2rem;
  padding: 0.75rem 2rem;
}
/******************Cards******************/
.card {
  border-radius: 10px;
  box-shadow: var(--box-shadow);
  overflow: hidden;
}
.card--primary .card__header {
  background: var(--color-primary);
}
.card--secondary .card__header {
  background: var(--color-secondary);
}

.card--secondary .badge--secondary {
  background: #02cdf1;
}

.card--primary .badge--primary {
  background: #126de4;
}

.card__header,
.card__body {
  padding: 2rem;
}

/******************Plans******************/

.plan__container {
  max-width: 500px;
  margin: 0 auto;
}

.plan {
  transition: all 0.3s ease;
  margin-bottom: 6rem;
}
.plan__name {
  color: white;
  font-size: 2.4rem;
  font-weight: 600;
  margin-top: 0;
}
.plan__price {
  font-size: 6rem;
  color: white;
  font-weight: 500;
}
.plan__billing-cycle {
  color: white;
  font-size: 2.4rem;
  font-weight: 500;
  opacity: 0.8;
  margin-right: 1rem;
}
.plan__description {
  display: block;
  text-transform: capitalize;
  color: white;
  font-size: 2rem;
  font-weight: 400;
  letter-spacing: 1px;
  margin-top: 1rem;
}

.plan--popular .card__header {
  position: relative;
}

.plan--popular .card__header::before {
  content: url(/images/popular.svg);
  width: 40px;
  display: inline-block;
  position: absolute;
  top: -6px;
  right: 10%;
}

.plan .list--tick .list__item {
  margin-bottom: 3rem;
  font-size: 2.4rem;
  font-weight: 500;
  letter-spacing: 1px;
  margin-top: 0;
}
.plan__btn {
  margin: 3rem 0 2rem 0;
}
.plan:hover {
  transform: scale(1.1);
}

.plan--popular.plan:hover {
  transform: scale(1.15);
}

@media (min-width: 768px) {
  .plan__container {
    display: flex;
    justify-content: space-evenly;
    max-width: 1200px;
  }
  .plan {
    padding: 0 2rem;
  }
  .plan__name {
    font-size: 1.4rem;
  }
  .plan__price {
    font-size: 5rem;
  }
  .plan__billing-cycle {
    font-size: 1.6rem;
  }
  .plan__description {
    font-size: 1.7rem;
  }
  .plan--popular.plan {
    transform: scale(1.1);
  }
}

/******************Grids******************/
.grid {
  display: grid;
}

@media screen and (min-width: 768px) {
  .grid--1x2 {
    grid-template-columns: repeat(2, 1fr);
  }
}

@media screen and (min-width: 1027px) {
  .grid--1x3 {
    grid-template-columns: repeat(3, 1fr);
  }
}
/******************Testimonials/Quotes******************/
.testimonial {
  padding: 4rem;
  margin-top: 4rem;
}
.testimonial__heading {
  text-align: center;
  margin-bottom: 0;
}
.container .testimonial__tagline {
  max-width: 850px;
  margin: 0 auto;
}
.testimonial__tagline {
  text-align: center;
}
.testmonial__image img {
  width: 100%;
}
.testmonial__quote {
  color: var(--color-body);
  margin: 2rem 0 0 5rem;
  font-size: 3rem;
  font-weight: 500;
  font-style: italic;
  opacity: 1;
}
.testmonial__quote-content::before {
  content: open-quote;
}
.testmonial__quote-content::after {
  content: close-quote;
}

.testmonial__image {
  position: relative;
}

.testmonial__quote-content {
  font-size: 3rem;
}
.testmonial__image .icon-container {
  position: absolute;
  top: 20px;
  right: -35px;
}
.quote__author {
  font-style: normal;
  font-size: 3rem;
}
.quote__oragnization {
  font-style: normal;
  font-size: 2rem;
  opacity: 0.4;
}

.quote__line {
  position: relative;
  top: 5px;
}

@media (min-width: 768px) {
  .testmonial__quote-content {
    font-size: 2.4rem;
  }
}
/******************Media ******************/
.media {
  display: flex;
}
.media__title {
  margin: 0 0 1rem 0;
}
.media__text {
  margin-top: 0;
}
.media__body {
  margin-top: 0.75rem;
  margin-left: 2rem;
}
.media__image {
  margin-top: 10px;
}

/******************Callout ******************/

.callout__container {
  max-width: 400px;
  margin: 0 auto;
  position: relative;
  bottom: -150px;
}
.callout {
  padding: 4rem;
  border-radius: 7px;
}
.callout--primary {
  background-color: #2584ff;
}
.callout__content {
  text-align: center;
}

.callout .callout__heading,
.callout .callout__content p {
  color: white;
}
.callout .btn {
  justify-self: center;
  align-self: center;
}

@media (min-width: 768px) {
  .callout__container {
    max-width: 980px;
    margin: 0 auto;
    position: relative;
    bottom: -150px;
  }

  .callout__content {
    text-align: left;
  }
  .callout .grid {
    grid-template-columns: 1fr auto;
  }
  .callout .btn {
    justify-self: start;
    margin: 0 2rem;
  }
}
/******************Collapsibles******************/
.collapsible__header {
  display: flex;
  justify-content: space-between;
}
.collapsible__heading {
  margin-top: 0;
}
.collapsible__toggler-icon {
  transform: rotate(-90deg);
  transition: all 0.3s ease;
}

.collapsible--expanded .collapsible__toggler-icon {
  transform: rotate(0);
}
.collapsible__content {
  max-height: 0;
  overflow: hidden;
  opacity: 0;
  transition: all 0.3s ease;
}
.collapsible--expanded .collapsible__content {
  max-height: 100vh;
  opacity: 1;
}

/******************NavBar ******************/

.navbar {
  background: black;
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
  align-items: center;
  padding: 1rem;
}
.navbar .nav__list {
  width: 100%;
  margin: 0;
}
.nav__list {
  padding-left: 2rem;
}
.nav__item a {
  color: rgba(255, 255, 255, 0.525);
  text-transform: capitalize;
  font-size: 1.6rem;
  transition: all 0.3s ease;
}
.nav__item {
  padding: 0.5rem 2rem;
  border-bottom: 1px solid rgba(255, 255, 255, 0.174);
}
.nav__item a:hover {
  color: white;
}

.collapsible__toggler-icon {
  opacity: 0.5;
}
.collapsible--expanded .collapsible__toggler-icon {
  opacity: 1;
  box-shadow: 0 0 10px 1px white;
  border-radius: 5px;
}

@media (min-width: 768px) {
  .collapsible__toggler-icon {
    display: none;
    transition: all 0.3s;
  }
  .collapsible__content {
    opacity: 1;
    max-width: 100vh;
  }
  .navbar .nav__list {
    width: auto;
    display: flex;
    font-size: 1.6rem;
    max-height: 100%;
    opacity: 1;
  }
  .nav__item {
    border: 0;
  }
}
/******************Block ******************/
.block {
  padding: 5rem;
  --padding-vertical: 6rem;
  padding: var(--padding-vertical) 2rem;
}
.block__header {
  text-align: center;
}

.block--dark {
  background: black;
  color: #7b858b;
}
.block--dark .block__heading {
  color: white;
  margin-top: 0;
}
.block--skewed-right {
  padding-bottom: calc(var(--padding-vertical) + 4rem);
  clip-path: polygon(0% 0%, 100% 0%, 100% 100%, 0% 90%);
}

.block--skewed-left {
  padding-bottom: calc(var(--padding-vertical) + 4rem);
  clip-path: polygon(0% 0%, 100% 0%, 100% 90%, 0% 100%);
}
/******************Hero ******************/
.hero .block__heading {
  margin-bottom: 0;
}
.hero__tagline {
  margin: 2rem 0;
  color: #b9c3cf;
}
.hero__image {
  width: 100%;
}
.hero {
  width: 100%;
}
@media (min-width: 768px) {
  .hero__content {
    text-align: left;
    align-self: center;
  }
}
/******************Domain Lookup ******************/
.block-domain .input-group {
  max-width: 850px;
  margin: 0 auto;
}

.block-domain__prices {
  text-align: center;
  text-transform: lowercase;
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  grid-template-rows: repeat(2, 1fr);
  justify-items: center;
  font-size: 2rem;
  font-weight: 600;
  max-width: 700px;
  margin: 0 auto;
}
.block-domain__prices li {
  margin-top: 3rem;
  font-size: 2rem;
}
@media screen and (min-width: 768px) {
  .block-domain__prices {
    grid-template-columns: repeat(auto-fit, minmax(10rem, 1fr));
  }
}
/******************Features******************/
.feature {
  margin-bottom: 10rem;

  gap: 0 5rem;
}
.image--feature {
  width: 100%;
}
.feature__heading {
  margin: 2rem 0;
}
.feature__text {
  margin-top: 0;
}
.feature__title {
  margin: 0 auto;
  text-align: center;
}
.feature--title__heading {
  margin-bottom: 0;
  margin-top: 12rem;
}
.feature--title__text {
  margin-top: 1rem;
  margin-bottom: 5rem;
}
.feature--title__text,
.feature--title__heading {
  text-align: center;
}
@media (min-width: 768px) {
  .feature:nth-of-type(even) .feature__content {
    order: 2;
  }
}
/******************ShowCase******************/
.showcase__image {
  width: 100%;
}

.shows-case__body__heading {
  text-align: left;
  color: white;
}
.show--case__body__text {
  text-align: left;
}

@media screen and (min-width: 768px) {
  .showcase__image {
    justify-self: end;
    max-width: 700px;
    width: auto;
  }
  .show-case .grid {
    grid-template-columns: 50% 50%;
  }
  .show--case__media-list {
    margin-top: 1remrem;
    margin-left: 5rem;
  }
}
/******************Footer******************/

.footer {
  background: #232323;
  padding: 20rem 2rem 1rem;
  justify-content: center;
  padding-bottom: 50px;
}
.footer__heading {
  text-transform: uppercase;
  color: white;
}

.footer .footer__heading {
  margin: 0;
  font-size: 3rem;
  font-weight: 500;
}

.footer__list a {
  color: rgba(255, 255, 255, 0.525);
  text-transform: capitalize;
  opacity: 0.5;
  transition: all 0.3s ease;
}
.footer__list a:hover {
  color: white;
  opacity: 1;
}

.footer__list li {
  margin-bottom: 2rem;
  font-size: 2rem;
  font-weight: 400;
}

.footer__brand {
  text-align: center;
}
.footer__copy-right {
  opacity: 0.3;
  margin-top: 0;
}
@media (min-width: 768px) {
  .footer {
    display: flex;
    padding-top: 20rem;
  }

  .footer .footer__heading {
    font-size: 1.6rem;
    text-align: left;
    font-weight: 600;
  }
  .footer__list li a {
    text-align: left;
    padding: 0;
    font-size: 1.5rem;
    font-weight: 300;
  }

  .footer .footer__list {
    width: auto;
    display: flex;
    flex-direction: column;
    font-size: 1.6rem;
    max-height: 100%;
    opacity: 1;
  }
  .footer .footer__brand {
    order: -1;
  }
  .footer__brand {
    margin: 5rem;
    align-self: center;
  }
  .footer--menue-title {
    margin: 0 3rem;
  }
}
